import { PieChart, Pie, Cell, Tooltip } from "recharts";
import { artistData } from "../data/seed";
import { AnyObject } from "../types";
import { useState } from "react";

const Charts = () => {
	const [data, setData] = useState<Array<AnyObject>>(artistData);

	const COLORS = ['#e6194b', '#3cb44b', '#ffe119', '#4363d8', '#f58231', '#911eb4', '#46f0f0', '#f032e6', '#bcf60c', '#fabebe', '#008080', '#e6beff', '#9a6324', '#fffac8', '#800000', '#aaffc3', '#808000', '#ffd8b1', '#000075', '#808080', '#ffffff', '#000000'];

	const idiomas = [
		{ name: "Español", value: 58 },
		{ name: "Inglés", value: 221 },
		{ name: "Japonés", value: 4 },
	];

	const data02 = [
		{ name: "Group A", value: 2400 },
		{ name: "Group B", value: 4567 },
		{ name: "Group C", value: 1398 },
		{ name: "Group D", value: 9800 },
		{ name: "Group E", value: 3908 },
		{ name: "Group F", value: 4800 },
	];

    console.log(data)

	return (
		<PieChart width={1000} height={400}>
			<Pie
				dataKey="value"
				isAnimationActive={false}
				data={idiomas}
				cx={200}
				cy={200}
				outerRadius={80}
				fill="#8884d8"
				label
			>
            {
          	idiomas.map((entry, index) => <Cell fill={COLORS[index % COLORS.length]}/>)
          }
          </Pie>
			<Pie
				dataKey="value"
				data={data02}
				cx={500}
				cy={200}
				innerRadius={40}
				outerRadius={80}
				fill="#82ca9d"
			/>
			<Tooltip />
		</PieChart>
	);
};

export default Charts;
